INSERT INTO `contact` VALUES (1,'Emin','fakecustomer1@gmail.com','Sifarişlə bağlı sual','Salam, Mən sizin məhsullarınızla bağlı bir sualım var. Zəhmət olmasa, mənə sifariş prosesini və ödəniş variantlarını ətraflı şəkildə izah edə bilərsiniz?','2023-06-04 14:08:17'),(2,'Azər','azercustomerfeedback2@gmail.com','Məhsul keyfiyyəti ilə bağlı şikayət','Salam, Son aldığım məhsuldan tamamilə razı deyiləm. Keyfiyyəti çox aşağı səviyyədədir. Zəhmət olmasa, bu məsələ ilə bağlı nəsə edə bilərsiniz?','2023-06-04 14:08:43'),(3,'Test','info.fakecompany3@gmail.com','Məhsullarınızla bağlı təklif','Salam, Sizin məhsullarınızı görəndən sonra bir təklifim var. Biz bir iş təklifi ilə əlaqədar danışmaq istərdik. Sizə bu barədə daha ətraflı məlumat verməyiniz mümkündür?','2023-06-04 14:09:10'),(4,'Azər','azersupport4@gmail.com','Sifarişlə bağlı sual','Salam, Sifarişlə bağlı bir sualım var. Mövcud olan endirimlərdən və kampaniyalardan xəbərdar ola bilərəmmi? Zəhmət olmasa, qiymət və satış şərtləri barədə məlumat verməyiniz mümkündür?','2023-06-04 14:09:30'),(5,'Qalib','fakeinquiry5@gmail.com','Məhsullarınız haqqında məlumat','Salam, Mən sizin məhsullarınız haqqında daha çox məlumat əldə etmək istəyirəm. Zəhmət olmasa, mənə əlavə məlumat və məhsulun keyfiyyəti barədə fikirlərinizi bildirə bilərsiniz?','2023-06-04 14:09:54'),(6,'Alim','azercustomerservice6@gmail.com','Sifariş dəstəyi tələbi','Salam, Sifarişimlə bağlı bir problemim var və dəstək tələb edirəm. Zəhmət olmasa, mənə yardım edə bilərsinizmi?','2023-06-04 14:10:26'),(7,'Company','info.fakecompany7@gmail.com','İş təklifi','Salam, Sizin şirkətiniz barədə maraqlı bir iş təklifi ilə bağlı danışmaq istərdim. Əlavə məlumat əldə etmək üçün sizinlə əlaqə saxlamaq istərdim.','2023-06-04 14:11:25'),(8,'Azad','azersupport8@gmail.com','Məhsullarınızla bağlı təklif','Salam, Mən sizin məhsullarınızı görəndən sonra bir təklifim var. Sizə bu barədə daha ətraflı məlumat verməyiniz mümkündür?','2023-06-04 14:11:57'),(9,'Rasim','fakeinquiry9@gmail.com','Məhsullarınız haqqında sual','Salam, Sizin məhsullarınızla bağlı bir neçə sualım var. Zəhmət olmasa, mənə məhsullarınızın keyfiyyəti və qiyməti barədə məlumat verə bilərsiniz?','2023-06-04 14:12:22'),(10,'Əkbər','fakeinquiry14@gmail.com','Məhsullarınız haqqında məlumat','Salam, Mən sizin məhsullarınız haqqında daha çox məlumat əldə etmək istəyirəm. Zəhmət olmasa, mənə əlavə məlumat və məhsulun keyfiyyəti barədə fikirlərinizi bildirə bilərsiniz?','2023-06-04 14:13:10'),(11,'Test2','info.fakecompany16@gmail.com','İş təklifi','Salam, Sizin şirkətiniz barədə maraqlı bir iş təklifi ilə bağlı danışmaq istərdim. Əlavə məlumat əldə etmək üçün sizinlə əlaqə saxlamaq istərdim.','2023-06-04 14:13:45'),(12,'Test3','fakecustomer18@gmail.com','Məhsul geri bildirimləri','Salam, Son aldığım məhsullarınızla bağlı bir neçə geri bildirimim var. Zəhmət olmasa, bununla bağlı mənə ətraflı məlumat verməyiniz mümkündür?','2023-06-04 14:15:15'),(13,'Aslan','azersupport19@gmail.com','Sifarişlə bağlı təklif','Salam, Mən sizin məhsullarınızı görəndən sonra bir təklifim var. Zəhmət olmasa, mənə əlavə məlumat və endirimlər barədə məlumat verə bilərsiniz?','2023-06-04 14:15:33'),(14,'Aa Company','info.fakecompany20@gmail.com','İş birliyi təklifi','Salam, Bizim şirkət sizinlə bir iş birliyi etmək istəyir. Biz sizin məhsullarınız barədə daha çox məlumat almaq istərdik. Zəhmət olmasa, bizimlə əlaqə saxlayın.','2023-06-04 14:15:59'),(15,'Test4','fakeinquiry21@gmail.com','Sifarişlə bağlı sual','Salam, Sifarişlə bağlı bir neçə sualım var. Zəhmət olmasa, sifariş prosesini və teslimat şərtlərini ətraflı şəkildə izah edə bilərsiniz?','2023-06-04 14:16:26'),(16,'aze service','azercustomerservice22@gmail.com','Məhsul dəstəyi','Salam, Mən son aldığım məhsulla bağlı bir problem yaşayıram. Zəhmət olmasa, mənə məhsulun qaytarılması və dəyişimi ilə bağlı kömək edə bilərsinizmi?','2023-06-04 14:17:09');
